import { Component } from 'react'

class AddContact extends Component{
    render(){
        return(
            <form onSubmit={this.props.formSubmit}>
                <label for='name'>name</label>
                    <input name='name' id='name' placeholder='enter name' ref={this.props.name}/>
                <label for='street'>street</label>
                    <input name='street' id='street' placeholder='enter street' ref={this.props.street}/>
                <label for='city'>city</label>
                    <input name='city' id='city' placeholder='enter city' ref={this.props.city}/>
                <label for='email'>email</label>
                    <input name='email' id='email' placeholder='enter email' ref={this.props.email} />
                <button onClick={this.props.formSubmit}>Submit</button>
            </form>
        )
    }
}

export default AddContact
